import React from "react";
import {Tabs, Tab} from 'react-bootstrap-tabs';

function EditorTabContain() {
  return (
    <div>
       <section>
                <h5>Single Tab</h5>
                <Tabs>
                    <Tab label="tab 1">One lonely tab 1</Tab>
                    <Tab label="tab 2">One lonely tab 2</Tab>
                    <Tab label="tab 3">One lonely tab 3</Tab>
          
                </Tabs>
            </section>
    </div>
  );
}

export default EditorTabContain;
